INSERT INTO `tbl_jobs` (`job_id`, `title`, `city`, `country`, `category`, `type`, `experience`, `description`, `responsibility`, `requirements`, `company`, `date_posted`, `closing_date`, `enc_id`) VALUES
('9036256452', 'Kế Toán (Tiếng Nhật)', 'Hà Nội', 'Vietnam', 'Accounting', 'Full-time', '2 Years', '<ul><li>Check payments, follow up and check all transactions according to the Japan law and to company requirements.</li><li>Check daily payment to ensure compliance company policy and accuracy.</li><li>Cross-check data among departments as: sale admin, PMO…</li><li>Check VAT invoice before issue to customer.</li><li>Record salary, insurance and other benefit related to employee expenses.</li><li>Follow up and record depreciation of fixed assets</li><li>Follow up and make the accrual/provision expenses</li><li>Guide solutions and recording for accounting transactions</li><li>Responsible for the month-end closing timely and accuracy</li><li>Summarizes current financial status by collecting information; preparing balance sheet, profit and loss statement, cash flow, and other reports.</li><li>Provide data for accounting Management</li><li>Performs the job in the accounting department as: following and checking on bank transaction, payment transfer, receivable and payable; issuing VAT invoice; and input data into accounting software.</li><li>Tax declaration and finalization (VAT, CIT, FCT, …)</li><li>Coordinates with other departments, internal audit from Head Office and external parties.</li><li>Other tasks assigned by the manager.</li></ul>', '<p>&nbsp;</p>', '<ul><li>University degree majoring in Accounting;</li><li>Has working experiences in foreign companies</li><li>Strong Japanese skills (N2)</li><li>Minimum 2 years experienced in accounting field;</li><li>Can be go to overseas business trip in short time.</li></ul>', 'CM427830221', 'May 15, 2022', '13/06/2022', 16),
('7648702381', 'Nhân Viên Chốt Lịch Hẹn - Làm Giờ Hành Chính - Hấp Dẫn Với Lương Cứng 7.000.000Đ + Thưởng Kpis Không Giới Hạn', 'TP Hồ Chí Minh', 'Vietnam', 'Trades and Services', 'Full-time', '3 Years', 'Gọi khách hàng qua nguồn khách hàng của công ty cung cấp, tư vấn gói sản phẩm chăm sức khỏe của Bảo Việt.<br>Giải đáp các thắc mắc của khách hàng, chốt thời gian và thủ tục để nhân viên xuống gặp trực tiếp khách hàng hoàn tất hồ sơ.<br>Thực hiện chỉ tiêu số lượng cuộc gọi và thời gian tiếp cập khách hàng mỗi ngày theo yêu cầu<br>Thời gian : Làm giờ hành chính, từ 8h00 – 17h00 (từ thứ 2 đến thứ 7)<br>Địa Chỉ :Transcosmos Lầu 10 tòa nhà Scetpa, 19A Cộng Hòa, phường 12, quận Tân Bình<br>', '&nbsp;', '???ng viên có kinh nghiệm telesales, tư vấn, CSKH, PG, Marketing là một lợi thế<br>Nam, Nữ: từ 19-35 tuổi Tốt nghiệp THPT trở lên<br>Thái độ tích cực, biết lắng nghe, chịu áp lực tốt<br>Có giọng nói dễ nghe, thích giao tiếp<br>', 'CM249039958', 'May 15, 2022', '11/06/2022', 17),
('4240463370', 'Nhân Viên Marketing (SEO - Ads - Content - Design - Wordpress) - Lương Cứng Từ 7 - 15 Triệu/ Tháng', 'TP Hồ Chí Minh', 'Vietnam', 'Marketing,Media and Brand', 'Full-time', '2 Years', '<p>1. CÔNG VIỆC SEO</p><ul><li>Nghiên cứu bộ từ khóa SEO; lên kế hoạch đẩy từ khóa.</li><li>Xây dựng và triển khai chiến lược link building, SEO Onpage, Offpage.</li><li>Quản lý chi phí chiến dịch; phân tích và tối ưu hiệu quả SEO.</li></ul><p>2. CÔNG VIỆC ADS</p><ul><li>Lên kế hoạch quảng cáo Facebook/Google phù hợp với chiến dịch Marketing của Công ty và đối tác khách hàng theo ngân sách được duyệt.</li><li>Theo dõi, đánh giá để tối ưu thiết kế/nội dung/chi phí và tỷ lệ chuyển đổi của các chiến dịch quảng cáo.</li></ul><p>3. CÔNG VIỆC CONTENT</p><ul><li>Sáng tạo và phát triển nội dung trên các kênh fanpage, website, youtube, tiktok... của công ty và đối tác khách hàng.</li><li>Phối hợp với các team Ads,Design... để minh họa cho các bài viết; nghiên cứu chủ đề, bài viết mới...</li><li>Cập nhật nội dung trang web, fanpage khi có yêu cầu.</li></ul><p>4. CÔNG VIỆC DESIGN</p><ul><li>Thiết kế các ấn phẩm trên các kênh Digital Marketing Online (giao diện landing page, website, banner, FB/GG Ads, thumbnail Youtube…) của Công ty và đối tác khách hàng.</li><li>Hỗ trợ thực hiện các công tác quảng bá thương hiệu và các công việc có liên quan.</li></ul><p>5. CÔNG VIỆC WORDPRESS</p><ul><li>Thiết kế và sử dụng tool (UX, Thrive, Elementor, và các tool khác) để làm website trên nền wordpress.</li><li>Thiết kế layout website, cắt HTML &amp; CSS các sản phẩm marketing; kết nối tools đưa ra funnels như active campaign, chatbot...</li></ul>', '&nbsp;&nbsp;', '<ul><li>Tốt nghiệp các chuyên ngành Marketing, Truyền thông, Ngoại ngữ hoặc các ngành liên quan...</li><li>Kinh nghiệm từ 06 tháng trở lên ở vị trí tương đương; nếu chưa có kinh nghiệm sẽ được training từ 02 - 03 tháng.</li><li>Kỹ năng xây dựng, triển khai kế hoạch, và kỹ năng quản lý tốt.</li><li>Nhanh nhẹn, nhiệt tình và quyết liệt với công việc.</li></ul>', 'CM766073055', 'May 15, 2022', '06/06/2022', 18),
('0932866193', 'Credit Officer (Finance Leasing)', 'TP Hồ Chí Minh', 'Vietnam', 'Banking and Financial Services', 'Full-time', 'Expert', '- Control the risk of each application and propose suitable credit line for each customer<br>- Analyze the applicant’s credit situation independently and systematically<br>- Prepare Credit Report in English<br>- Present the proposal to the Authorities for final decision<br>- Update industry information for the industry report regularly<br>- Other tasks are allocated by the Credit Manager<br>- More details will be discussed at the interview.<br>', '&nbsp;', '<p>Requirement:<br>- Fluent in English speaking and writing<br>- Bachelor degree or above, majored in Economics, Banking, Finance<br>- Basic Microsoft Office (Power point, Word, Excel)<br>- Strong analytical mind, team spirit &amp; able to work under pressure</p><p>Location: HCM, Ha Noi, Hai Phong, Binh Duong<br>- HCM: 28F, Saigon Trade Center, 37 Ton Duc Thang St., Ben Nghe ward, Dist. 1, HCMC<br>- Ha Noi: 20F, CEO Tower, HH2-1, Pham Hung St., Me Tri Commune, Nam Tu Liem Dist., HN<br>- Hai Phong: 7F, Sacombank Tower, Le Chan District, Hai Phong<br>- Binh Duong: 12A FL, Becamex Tower, 230 Binh Duong Avenue, Phu Hoa ward, Thu Dau Mot City, Binh Duong province<br>- Can Tho: 5F, Hòa Bình Building, 14-16B Hòa Bình st., Ninh Kiều dist, Cần Thơ city.<br>- Long An: 2F, No. 2, 1A highway, Tan An city, Long An.</p>', 'CM456590833', 'May 15, 2022', '17/06/2022', 19),
('4644119845', 'Chuyên Viên Tư Vấn Bán Hàng Mỹ Phẩm Cao Cấp Tại Trung Tâm Thương Mại (Thu Nhập Từ 8-20M) - Hà Nội', 'Hà Nội', 'Vietnam', 'Marketing,Media and Brand', 'Full-time', '4 Years', '- Bán hàng tại Showroom mỹ phẩm cao cấp trong TTTM Vincom<br>- Mời khách trải nghiệm dùng thử sản phẩm tại showroom<br>- Làm test thử mỹ phẩm chăm sóc da cho khách hàng tại showroom<br>- Tư vấn sản phẩm phù hợp cho khách hàng<br>- Làm việc Fulltime theo ca - xoay ca (ca 1: 9:30-17:30, ca 2: 14:00-22:00, nghỉ giữa ca 45 phút).<br>', '&nbsp;', '- Có thể làm việc theo ca<br>- Có ít nhất 1-2 năm kinh nghiệm bán hàng trực tiếp<br>- Đam mê sales, % Hoa hồng lớn<br>- Chưa có kinh nghiệm về mỹ phẩm/làm đẹp sẽ được đào tạo từ A-&gt;Z<br>- Nếu có thể giao tiếp tiếng Anh mức lương cơ bản sẽ cao hơn<br>', 'CM292799128', 'May 15, 2022', '15/05/2022', 20),
('7466279653', 'Trưởng Phòng Kỹ Thuật (Đà Nẵng)', 'Đà Nẵng', 'Vietnam', 'IT and Telecoms', 'Full-time', '5 Years', '<ul><li>Lập kế hoạch, thiết kế, triển khai hệ thống hạ tầng của Công ty tại khu vực quản lý.</li><li>Chịu trách nhiệm quản lý hoạt động phát triển, thi công và bảo trì, xử lý sự cố hệ thống trên hạ tầng.</li><li>Chịu trách nhiệm quản lý triển khai, bảo trì thuê bao internet FPT đảm bảo KPI công ty đặt ra.</li><li>Duy trì, phát triển các mối quan hệ với &nbsp;các ban ngành địa phương, điện lực nhằm giải quyết các vấn đề phát sinh.</li><li>Đảm bảo hệ thống, tín hiệu vận hành ổn định.</li><li>Tham gia vào hoạt động phát triển vùng phủ khi được yêu cầu.</li><li>Xây dựng, phát triển đội ngũ cán bộ kỹ thuật triển khai, bảo trì hạ tầng mạng viễn thông. Đội ngũ kỹ thuật viên triển khai, bảo trì thuê bao.</li></ul>', '&nbsp;', '<ul><li>Nam, tuổi từ 25 đến 40.</li><li>Tốt nghiệp Cao đẳng trở lên chuyên ngành &nbsp;Điện, Công nghệ thông tin hoặc Điện tử viễn thông.</li><li>Có chứng chỉ CCNA, CCNP, các chứng chỉ thiết kế, dự toán, vận hành.. là lợi thế.</li><li>Tối thiểu 1-2 &nbsp;năm kinh nghiệm hoạt động trong lĩnh vực viễn thông và ít nhất 1 năm ở vị trí trưởng nhóm.</li><li>Hiểu biết về các thiết bị viễn thông, có thế mạnh về IP và hệ thống. Hiểu biết các quá trình thiết kế, triển khai, giám sát triển khai mạng GPON, ADSL. </li><li>Khả năng quyết đoán trong giải quyết tình huống và sự cố kỹ thuật</li><li>Có kỹ năng quản lý và đào tạo nhân viên. Ưu tiên ứng viên cư trú tại địa phương.</li></ul>', 'CM108313120', 'May 15, 2022', '01/07/2022', 21),
('1152699750', 'Nhân Viên IT Helpdesk Khu Vực Hà Nội', 'Hà Nội', 'Vietnam', 'IT and Telecoms', 'Full-time', '2 Years', '<p>1. Manage workstations and the softwares installed in workstations</p><ul><li>Install workstations and client softwares, check the necessary software programs needing for workstations to function (virus, office, unikey, specialized software for each department)</li><li>Join domain for the workstation, check the public drive for users</li><li>Transfer/ recall devices</li><li>Maintain periodically workstations</li></ul><p>2. Support the end users to user the computer systems, phones and softwares</p><ul><li>Fix software errors directly on the computer or via softphone and application softwares helping to serve the activities of the company</li><li>Remove unnecessary or harmful softwares on the user’s devices</li><li>Guide to use for the users</li><li>Install the computer softwares for the end users</li><li>Support all the errors of softphone and IP Phone</li><li>Set up meeting rooms</li><li>Write guiding documents to assist the end users<br>&nbsp;</li></ul><p>3. Support the other works of IT &amp; Infrastructure Department</p><ul><li>Support to install and maintain the network system</li><li>Support to monitor the server operation<br>&nbsp;</li></ul><p>4. Advise head of department on system management and development</p>', '&nbsp;', '<ul><li>Graduated from College (at least) with a good degree or higher majoring in Information Technology, Electronics and Telecommunications...</li><li>Language proficiency: English, equivalent to TOEIC 450 points or higher.</li><li>Well understand the Information technology system</li><li>Have a thorough understanding of the involved processes.</li><li>Having teamwork skill</li><li>Well communicate with all levels and users inside and outside the Company</li><li>Morality: Honesty, hard work, agility...</li><li>Comfortable with handling ambiguity and willingness to keep learning</li><li>Deep customer focus and strong sense of ownership</li><li>Good teamwork and communication skills.</li></ul>', 'CM655496961', 'May 15, 2022', '22/06/2022', 22),
('4425550271', 'Chuyên Viên Kinh Doanh Sàn Thương Mại Điện Tử (Sales Ecommerce)', 'Hà Nội', 'Vietnam', 'Trades and Services', 'Full-time', '4 Years', '<p>- Xác định, xây dựng và triển khai các kế hoạch phát triển doanh thu nhóm hàng phụ trách trên trang Thương mại điện tử, Website/ App của công ty.</p><p>- Theo dõi doanh thu nhóm Ngành hàng/ sản phẩm được phụ trách.</p><p>- Xây dựng chương trình bán hàng và chương trình khuyến mãi, đề xuất các hoạt động Marketing nhằm thúc đẩy doanh số.</p><p>- Theo dõi, phân tích các chỉ số, đánh giá và đưa ra đề xuất cải thiện các chiến dịch, chương trình khuyến mãi sau khi triển khai</p><p>- Phối hợp với bộ phận Ngành hàng xây dựng kế hoạch nhập hàng hóa theo Tháng/ Quý/ Năm.</p><p>- Báo cáo công việc cho cấp quản lý trực tiếp</p>', '&nbsp;', '<p>- Nam/Nữ đã tốt nghiệp từ Trung cấp trở lên các ngành kinh tế, thương mại,thương mại điện tử,...</p><p>- Ưu tiên ứng viên đã có kinh nghiệm làm việc tại vị trí tương tự hoặc làm việc với các đối tác E–Commerce</p><p>- Có kiến thức về Content, Campaing MKT,ưu tiên có khả năng chạy Digital.</p><p>- Có ý thức tổ chức kỷ luật cao, có thái độ làm việc nghiêm túc, chịu được áp lực cao trong công việc.</p><p>- Có laptop cá nhân để làm việc</p>', 'CM917255147', 'May 15, 2022', '05/07/2022', 23),
('8979572590', 'Kế Toán Thu Chi Kiêm Hành Chính', 'TP Hồ Chí Minh', 'Vietnam', 'Accounting', 'Full-time', '2 Years', '<p>+ Lập phiếu thu, phiếu chi hằng ngày;</p><p>+ Kiểm tra tính hợp lý, chính xác của các hóa đơn, chứng từ liên quan đến các khoản chi phí của công ty;<br>+ Chấm công nhân sự,làm bảng lương hàng tháng;<br>+ Tham dự các Event của công ty;<br>+ Công việc đơn giản và sẽ được training bổ sung các kỹ năng cần thiết;<br>+ Các trách nhiệm khác theo phân công của quản lý;</p><p>+ Các công việc hành chính văn phòng</p>', '&nbsp;', '<p>+ Nữ ở Tỉnh sinh năm 98-95;<br>+ Tốt nghiệp cao đẳng trở lên;</p><p>+ Có kinh nghiệm đã làm kế toán là một lợi thế,<br>+ Thật thà,cẩn thận, tỉ mỉ, nhanh nhẹn về số liệu;<br>+ Ham học hỏi,chịu được áp lực công việc khi cần báo cáo;<br>+ Biết sử dụng các chương trình đơn giản như Word, Excel;</p>', 'CM704400294', 'May 15, 2022', '31/05/2022', 24),
('9365125423', 'Lead Generation Director', 'Hà Nội', 'Vietnam', 'Accounting', 'Full-time', '5 Years', '<div><p>- The primary and utmost responsibility of the position is to bring good quality leads to the Company through personal contact, partnership, or the data provider. <br>- Create and implement a strategy or program to set <br>up a relationship with decision-makers/influencers or organizations who e can give ALMA <br>valuable and active leads. <br>- Create and manage campaigns or programs to deploy leads in different channels<br>- Develop customer data source, brand, market research partnership programs/ policies.<br>- Measure the effectiveness of lead collection activities.<br>- Manage OPC Team (outside personal contact) who work <br>in a promotion spot, including support arranging locations for the survey. <br>- Managing and developing employees with good results.</p></div>', '&nbsp;', '- Graduated from University upwards<br>- Fluently in English skills.<br>- Knowledge of real estate, corporate sales, insurance, bank – direct <br>sales industry<br>- Experience in operating and marketing management or sales over five years.<br>- Good presentation, negotiation, and working skills with customers.<br>- Excellent business networks, know how to build up relationships with businesses. <br>- On the field manager: always hands-on and manage day-to-day targets closely.<br>', 'CM057207572', 'May 15, 2022', '20/05/2022', 25);

