INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('Công Ty Cổ Phần Viễn Thông FPT', '', '-', '-', '-', ' ', 'company10@gmail.com', '-', 'Du Lịch', 'Hà Nội', ' ', ' ', 'Vietnam', '+84123456789', 'Công ty TNHH Khu Du Lịch Vịnh Thiên Đường (ALMA) hoạt động trong lĩnh vực du lịch nghỉ dưỡng. Chính thức ra mắt với công chúng từ năm 2013, trải qua quá trình phát triển, Công ty TNHH Khu Du Lịch Vịnh Thiên Đường – Công ty ALMA bao gồm 4 chi nhánh hoạt động tại các thành phố lớn là Hà Nội, Hồ Chí Minh và Nha Trang với tổng số hơn 500 nhân sự. &nbsp;<br>', , '<p>Với mong muốn mang đến cho các gia đình Việt Nam những phút giây đoàn viên hạnh phúc hằng năm, ngài Igal Ahouvi – Lãnh sự Danh dự Việt Nam tại Israel đã đầu tư xây dựng dự án Khu nghỉ dưỡng ALMA sang trọng bao gồm nhiều tiện ích cao cấp. Thông qua dự án ALMA, Công ty TNHH Khu Du Lịch Vịnh Thiên Đường là đơn vị tiên phong mang đến Việt Nam mô hình “Sở hữu Kỳ nghỉ” nơi các thế hệ gia đình có thể quây quần bên nhau và tận hưởng không gian nghỉ dưỡng đẳng cấp trong suốt nhiều năm</p>', 'Sứ mệnh của chúng tôi là mang tới những kỳ nghỉ hạnh phúc trọn đời với tiêu chuẩn quốc tế cho các gia đình Việt Nam thông qua khu nghỉ dưỡng đặc biệt - ALMA.<br>', '1-10', '15-05-2022 07:05 PM [EAT +03:00]', 'employer', 'http://alma.vn/', '25f9e794323b453885f5181f1b624d0b', 'CM057207572');
INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('Công Ty Cổ Phần Viễn Thông FPT', '', '-', '-', '-', '2003', 'company6@gmail.com', '-', 'Viễn Thông', 'Hà Nội', 'Phố Duy Tân, Cầu Giấy, ', ' V', 'Vietnam', '+84123456789', 'Là thành viên thuộc Tập đoàn công nghệ hàng đầu Việt Nam FPT, Công ty Cổ phần Viễn thông FPT (tên gọi tắt là FPT Telecom) hiện là một trong những nhà cung cấp dịch vụ viễn thông và Internet có uy tín và được khách hàng yêu mến tại Việt Nam và khu vực.<br>', , 'Thành lập ngày 31/01/1997, khởi nguồn từ Trung tâm Dịch vụ Trực tuyến do 4 thành viên sáng lập cùng sản phẩm mạng Intranet đầu tiên của Việt Nam mang tên “Trí tuệ Việt Nam – TTVN”, sản phẩm được coi là đặt nền móng cho sự phát triển của Internet tại Việt Nam. Sau 20 năm hoạt động, FPT Telecom đã lớn mạnh vượt bậc với hơn 7,000 nhân viên chính thức, gần 200 văn phòng điểm giao dịch thuộc hơn 80 chi nhánh tại 59 tỉnh thành trên toàn quốc. Bên cạnh đó, Công ty đã và đang đặt dấu ấn trên trường quốc tế bằng 8 chi nhánh trải dài khắp Campuchia, cũng như việc được cấp giấy phép kinh doanh dịch vụ tại Myanmar.<br>', 'Với sứ mệnh tiên phong đưa Internet đến với người dân Việt Nam và mong muốn mỗi gia đình Việt Nam đều sử dụng ít nhất một dịch vụ của FPT Telecom, đồng hành cùng phương châm “Khách hàng là trọng tâm”, chúng tôi không ngừng nỗ lực đầu tư hạ tầng, nâng cấp chất lượng sản phẩm – dịch vụ, tăng cường ứng dụng công nghệ mới để mang đến cho khách hàng những trải nghiệm sản phẩm dịch vụ vượt trội.<br>', '1000+', '15-05-2022 07:05 PM [EAT +03:00]', 'employer', 'https://fptjobs.com', '25f9e794323b453885f5181f1b624d0b', 'CM108313120');
INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('TransCosmos Việt Nam', '', '-', '-', '-', '2014', 'company2@gmail.com', '-', 'Công Ty TNHH', 'TP Hồ Chí Minh', 'Số 20 Cộng Hòa, Phường 12, Quận Tân Bình', '-', 'Vietnam', '+84123456789', '<p>Được thành lập vào năm 1966 tại Shibuya, Tokyo, Nhật Bản, tập đoàn Transcosmos Inc đã nhanh chóng mở rộng quy mô tại 32 quốc gia trên toàn thế giới với 172 địa điểm cho đến nay.</p><p>Tại Việt Nam, trụ sở chính của Transcosmos được thành lập tại Hà Nội vào năm 2014. Hơn nữa, Transcosmos Việt Nam đã phát triển nhanh chóng thành thị trường lớn nhất của Thành phố Hồ Chí Minh. Tính đến nay, TCV đã có 6 trung tâm lớn với hơn 2.000 nhân viên trên toàn quốc.</p><p>Transcosmos Việt Nam sở hữu nguồn nhân lực dồi dào với sự chuyên nghiệp và kinh nghiệm, trải qua quá trình tuyển chọn và đào tạo, lựa chọn phù hợp với yêu cầu khác nhau của Khách hàng.<br></p><p>Transcosmos Việt Nam hướng tới mục tiêu trở thành nhà cung cấp dịch vụ khách hàng tốt nhất, trở thành vị thế cạnh tranh trên thị trường với chiến lược rõ ràng và giữ vững thương hiệu toàn cầu Nhật Bản đối với các doanh nghiệp kinh doanh.</p>', , '<p>Transcosmos Việt Nam cung cấp tất cả các giải pháp về dịch vụ khách hàng, tiếp thị từ xa và bán hàng qua điện thoại, dịch vụ trung tâm liên lạc 24/7, giải pháp kỹ thuật, tiếp thị kỹ thuật số, quản lý dự án, phát triển kinh doanh, thu nhận và phát triển nhân tài, v.v.</p><p>Là nhà cung cấp dịch vụ chính của Contact Center, Transcosmos Việt Nam nhận được lượng lớn cuộc gọi đến, cũng như thực hiện nhiều cuộc gọi đi đến người dùng cuối, đưa ra các giải pháp văn phòng tiện lợi nhằm nâng cao mối quan hệ hợp tác lâu dài giữa Khách hàng và TCV .</p>', 'Transcosmos Việt Nam - đối tác dịch vụ khách hàng cung cấp các giải pháp chất lượng cao và hiệu quả.<br>', '1000+', '15-05-2022 06:05 PM [EAT +03:00]', 'employer', 'https://trans-cosmos.com.vn/vi/?locale=en', '25f9e794323b453885f5181f1b624d0b', 'CM249039958'),
('Công Ty TNHH Milensea Retail', '', '-', '-', '-', '2015', 'company5@gmail.com', '-', 'Mỹ Phẩm', 'TP Hồ Chí Minh', 'Tầng 17, Tòa Nhà Pearl Plaza, 561A Điện Biên Phủ, P. 25, Quận Bình Thạnh', ' ', 'Vietnam', '+84123456789', '<p>“Cuộc sống là sẻ chia”, với phương châm sống này, từ năm 2010, Ông Tal Siman Tov cùng vợ là Bà Sima Siman Tov, 2 người con của vùng đất thánh Jerusalem, đã mang những bí truyền làm đẹp từ quê hương sở tại đi khắp khu vực Đông Nam Á với mong muốn chăm sóc và giữ gìn vẻ đẹp cùng làn da cho người phụ nữ Á Đông.</p><p>Đem chuông đi đánh xứ người, Tal và Sima đã mang những thương hiệu mỹ phẩm cao cấp nhất, những bí truyền làm đẹp quý nhất từ Israel đến Singapore rồi Thái Lan và đều tạo được tiếng vang cùng sự trung thành từ khách hàng và người tiêu dùng.</p><p>Năm 2015, sau chuyến du lịch đến Việt Nam, Tal và Sima đã yêu đất nước hình chữ S với nét văn hóa đặc biệt và đa dạng cùng sự thân thiện của con người nơi đây. Đây là động lực khiến Tal và Sima quyết định dừng con thuyền viễn du Đông Nam Á của họ và thả neo.</p><p>Ngày 18 tháng 11 năm 2016, CTY TNHH MILENSEA RETAIL chính thức được thành lập tại Thành Phố Hồ Chí Minh.</p><p>Đến cuối năm 2020, MilenSea đã có hệ thống 17 cửa hàng phân phối mỹ phẩm từ Biển Chết tại các trung tâm thương mại lớn trên toàn quốc.</p>', , '&nbsp;', 'Tại thị trường Việt Nam, MilenSea LÀ NHÀ PHÂN PHỐI ĐỘC QUYỀN CÁC THƯƠNG HIỆU MỸ PHẨM CAO CẤP: Aqua Mineral, Botanifique, Gold Elements.<br>', '300+', '15-05-2022 06:05 PM [EAT +03:00]', 'employer', 'https://milensea.com.vn/', '25f9e794323b453885f5181f1b624d0b', 'CM292799128');
INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('CMC GLOBAL', '', '-', '-', '-', '-', 'company1@gmail.com', '-', 'Công Ty TNHH ', 'Hà Nội', 'Duy Tân, Cầu Giấy', '-', 'Vietnam', '+84123456789', 'CMC Global ra đời từ kinh nghiệm 25 năm trong lĩnh vực ICT và hơn 10 năm kinh nghiệm trong lĩnh vực Outsourcing của Tập đoàn công nghệ CMC, với sứ mệnh trở thành đơn vị cung cấp nhân lực kỹ sư phần mềm chất lượng cao, cung cấp các giải pháp, dịch vụ CNTT cho thị trường quốc tế. Hiện CMC Global đang sở hữu đến 700++ nhân viên, cùng một công ty thành viên tại Nhật Bản.<br>Tập đoàn công nghệ CMC cùng CMC Global tự hào là một trong những doanh nghiệp hàng đầu Việt Nam trong lĩnh vực phát triển, cung cấp các giải pháp và dịch vụ phần mềm. Chia sẻ chung những tiêu chí tiên quyết cho sự phát triển của Tập đoàn CMC: Sáng tạo, Chuyên nghiệp, Đồng đội, CMC Global luôn nỗ lực không ngừng để xây dựng một tập thể vững mạnh, tiên phong trong nền công nghệ Việt Nam và ngày một vươn xa ra thế giới.<br>', , 'Với mục tiêu đưa các sản phẩm và dịch vụ công nghệ cao của CMC ra thế giới, CMC Global đang xây dựng những nền móng đầu tiên với tham vọng: có ít nhất 2.000 người làm việc ở nước ngoài vào năm 2022; doanh thu phần mềm và dịch vụ từ thị trường xuất khẩu lớn hơn thị trường trong nước; có nhiều sản phẩm và dịch vụ đạt tiêu chuẩn hàng đầu thế giới. Trong tương lai, ngoài công ty thành viên CMC Japan tại Nhật Bản, CMC Global sẽ mở thêm các chi nhánh tại các nước châu Á như Singapore, Malaysia,….<br>', 'Chiến lược đầu tư của CMC Global được định vị có phần khác biệt so với các công ty outsourcing cũng ngành ở thị trường Việt Nam. CMC Global sẽ chú trọng vào việc phát triển nguồn lực, chuẩn hóa qui trình cung cấp dịch vụ và phát triển phần mềm, đào tạo nhân sự chất lượng cao, cùng lúc thu hút số lượng lớn các nhân tài trong lĩnh vực công nghệ thông tin. Đồng thời, CMC Global cũng sẽ là đại diện, cầu nối cho các công ty thành viên của CMC trong việc cung cấp các giải pháp và dịch vụ tích hợp trọn gói ra thế giới.<br>', '1000+', '15-05-2022 06:05 PM [EAT +03:00]', 'employer', 'http://cmcglobal.com.vn/', '25f9e794323b453885f5181f1b624d0b', 'CM427830221');
INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('Công Ty Cho Thuê Tài Chính TNHH MTV Quốc Tế Chailease', '', '-', '-', '-', '2006', 'company4@gmail.com', '-', 'Tài Chính', 'Tp. HCM', ' Lầu 28, Cao ???c Saigon Trade Centre 37 Tôn Ðức Thắng, Phường Bến Nghé, Quận 1', ' ', 'Vietnam', '+84123456789', '<p>Công ty Cho Thuê Tài Chính TNHH Một Thành Viên Quốc Tế Chailease (\"\"CILC\"\") là tổ chức tín dụng 100% vốn nước ngoài thuộc Chailease Finance Group – là tập đoàn cho thuê tài chính hàng đầu ở Đài Loan với hơn 40 năm kinh nghiệm và có hoạt động kinh doanh tại các quốc gia thuộc lãnh thổ Trung Quốc, Đài Loan, Châu Á Thái Bình Dương và Hoa Kỳ.<br></p><p>Sứ mệnh:</p><p>&nbsp;- Đối tác hỗ trợ cho thành công của khách hàng.</p><p>&nbsp;- Động lực cho sự thành công về kinh tế.</p><p>Tầm nhìn:</p><p>- Trở thành một tổ chức tín dụng xuất sắc tại Việt Nam.</p><p>Giá trị cốt lõi:</p><p>&nbsp;- Giá trị (Value): sáng tạo để đôi bên cùng có lợi.</p><p>&nbsp;- Phát triển (Growth): sẵn sàng học hỏi liên tục và duy trì phát triển lâu dài.</p><p>&nbsp;- Tín nhiệm (Trust): phục vụ khách hàng một cách trung thực, tôn trọng và tận tâm.</p><p>&nbsp;- Kỷ luật (Discipline): xung phong đảm nhận trách nhiệm và thực hiện kế hoạch tập thể.</p>', , 'CILC được Ngân Hàng Nhà Nước Việt Nam cấp giấy phép thành lập vào năm 2006 và bắt đầu đi vào họat động tại Việt Nam năm 2007. CILC thực hiện dịch vụ cho thuê tài chính tài sản trong nước, mua và cho thuê lại, cho thuê tài chính tài sản nhập khẩu với những máy móc thiết bị và phương tiện vận chuyển …cho những doanh nghiệp tại Việt Nam.<br>', '&nbsp;', '300+', '15-05-2022 06:05 PM [EAT +03:00]', 'employer', 'https://www.chailease.com.vn/vn/', '25f9e794323b453885f5181f1b624d0b', 'CM456590833'),
('Tiki Corporation', '', '-', '-', '-', '2010', 'company7@gmail.com', '-', 'Thương Mại điện Tử', 'TP Hồ Chí Minh', 'TIki Base Camp - Lầu 3, Tòa Nhà Viettel Building, 285 Cách Mạng Tháng 8, Phường 12, Quận 10', ' ', 'Vietnam', '+84123456789', 'Tiki viết tắt của \"\"Tìm kiếm &amp; Tiết kiệm\"\", hiện là trang mua sắm trực tuyến đáng tin cậy nhất trong lĩnh vực thương mai điện tử tại Việt Nam.<br>', , 'Tiki còn được biết đến với dịch vụ TikiNow mang đến trải nghiệm nhận hàng nhanh trong 2 giờ duy nhất tại Việt Nam hiện nay. Tiki hiện đang cung cấp hơn 500,000 sản phẩm của hơn 6,500 thương hiệu uy tín, đáp ứng nhu cầu mua sắm đa dạng của khách hàng từ Sách, Sản phẩm điện tử, Dịch vụ số, Hàng gia dụng, Mẹ &amp; Bé, Thời trang, Làm đẹp &amp; Chăm sóc sức khỏe, cho đến Bách hóa online.<br>', 'Với tầm nhìn: \"\"Trang thương mại điện tử tin cậy nhất Việt Nam\"\" và sứ mệnh: \"\"Mang trải nghiệm mua sắm trực tuyến tốt nhất đến khách hàng\"\". Sau hơn 10 năm hoạt động với những bước phát triển nhanh chóng, Tiki tự hào đứng trong Top 10 doanh nghiệp có ảnh hưởng lớn nhất đối với việc phát triển Internet Việt Nam trong suốt thập kỷ vừa qua (2007-2017) do Hiệp hội Internet Việt Nam bình chọn. <br>', '1000+', '15-05-2022 07:05 PM [EAT +03:00]', 'employer', 'https://tuyendung.tiki.vn/', '25f9e794323b453885f5181f1b624d0b', 'CM655496961'),
('CÔNG TY CỔ PHẦN BABYLONS', '', '-', '-', '-', ' 2008', 'company9@gmail.com', '-', 'Thương Mại điện Tử', 'TP Hồ Chí Minh', 'Phố Duy Tân, Cầu Giấy', ' ', 'Vietnam', '+84123456789', 'Babylons là một doanh nghiệp hoạt động trong lĩnh vực giáo dục. Với tâm niệm “giáo dục là vũ khí giúp thay đổi thế giới”, ông Phạm Tuấn Sơn - Giám đốc và là người sáng lập Babylons, cho rằng, để đạt được thành công, thì tư duy chiếm đến 80%, còn lại 20% là kỹ năng, không chỉ với Babylons mà các doanh nghiệp khác muốn thành công thì cũng tương tự như vậy. Đó là điểm khác biệt của Babylons khi xác định hướng đi đầu tư vào lĩnh vực giáo dục. <br><p>Babylons đã hợp tác với nhiều diễn giả uy tín hàng đầu trên thế giới như: Shark Tank Mỹ - Daymond John; Tom Hopkins (huyền thoại bán hàng nước Mỹ); tỷ phú Mark Mobius, Anthony Robbins, Robert Kiyosaki, Jay Abraham… mời họ tham gia vào các khóa đào tạo - hội thảo quốc tế do Babylons tổ chức, để truyền đạt kiến thức, những bài học kinh nghiệm. Những kiến thức, kỹ năng đó gần như không có trong sách vở, mà đều xuất phát từ thực tiễn của chính những con người luôn có xu hướng nhanh nhạy nắm bắt thị trường, từng trải và vượt qua khó khăn, thử thách trên con đường lập nghiệp và họ đã thành công. Đó thực sự là những tri thức quý báu cho các doanh nhân trẻ, các nhà doanh nghiệp của Việt Nam tham khảo và vận dụng trong thời đại hội nhập quốc tế.</p><p>Qua 12 năm hoạt động (từ năm 2009), Babylons đã tổ chức thành công hàng nghìn khóa học - hội thảo ở trong và ngoài nước về kinh doanh, đầu tư, quản lý tài chính, với hàng triệu lượt người đã tin tưởng tham gia để tiếp cận các kiến thức, kinh nghiệm dấn thân trên thương trường, từ đó có thể vận dụng phù hợp vào bối cảnh của mình để kinh doanh, lập nghiệp. Tại Việt Nam, hoạt động của Babylons đã được nhiều người biết đến là \"Thương hiệu mạnh - Phát triển bền vững\", do Liên hiệp Các Hội khoa học và kỹ thuật Việt Nam và Bộ Công Thương vinh danh, bởi Babylons đã nỗ lực ứng dụng khoa học - công nghệ để tạo ra dịch vụ chất lượng, đáp ứng nhu cầu thị trường, mang lại nhiều lợi ích cho khách hàng, nâng cao năng lực cạnh tranh, góp phần vào sự phát triển kinh tế đất nước.</p><p>Cá nhân ông Phạm Tuấn Sơn, cũng đã được nhận giải thưởng Doanh nhân/Doanh nghiệp tiêu biểu do Hiệp hội Doanh nghiệp nhỏ và vừa Việt Nam trong Chương trình Tôn vinh doanh nghiệp, doanh nhân đạt thành tích nổi bật về kinh doanh, phát triển ổn định và tích cực tham gia các hoạt động kinh tế - xã hội của đất nước. Đến năm 2019, Babylons tiếp tục lọt vào TOP 10 công ty có sản phẩm dịch vụ chất lượng cao do Hiệp hội Doanh nhân đất Việt trao tặng và Viện Nghiên cứu kinh tế châu Á vinh danh trong TOP 10 thương hiệu xuất sắc - nhà lãnh đạo tiêu biểu thời hội nhập quốc tế.</p><p>Đặc biệt, năm 2020 vừa qua, mặc dù đại dịch Covid-19 tác động tiêu cực khiến nhiều doanh nghiệp thuộc nhiều lĩnh vực phải ngừng hoạt động, hoặc giải thể, nhưng Babylons vẫn phát triển là một trong 38 công ty của Việt Nam được nhận Giải thưởng SME100 châu Á - một chương trình đánh giá áp dụng các tiêu chí đánh giá định lượng và định tính, tập trung vào tăng trưởng (doanh thu, lợi nhuận và thị phần) và khả năng vận hành (chất lượng sản phẩm dịch vụ, những phương thức hiệu quả, tính bền vững, ảnh hưởng đến cộng đồng, và tầm nhìn) để xác định và công nhận các doanh nghiệp vừa và nhỏ hoạt động tốt trong khu vực.</p><p>Nói về định hướng và tầm nhìn phát triển của Babylons trong ngắn hạn cũng như trong dài hạn, lãnh đạo của Babylons, nhận định: Con đường kinh doanh của Babylons phía trước sẽ vẫn còn đầy những thách thức, khó khăn. Phương châm phát triển của Babylons, là luôn chuẩn bị tốt nhất cho những tình huống xấu nhất trong quá trình phát triển doanh nghiệp của mình, ngay cả khi đạt được những thành công và vinh quang nhất. Với tinh thần không bao giờ ngủ quên trên “Vòng Nguyệt Quế”, lãnh đạo của Babylons tin rằng, Babylons Group sẽ vượt qua được những khó khăn, thách thức phía trước, sẽ tiếp tục khẳng định được tên tuổi, thương hiệu của mình trên thương trường, qua đó góp phần thúc đẩy phát triển khởi nghiệp, kinh doanh, phát triển kinh tế, xã hội của đất nước...</p>Tầm nhìn của Babylons trong thời gian tới, đã được xác định, đó là tiếp tục đầu tư sâu sắc trong lĩnh vực giáo dục. Lãnh đạo của Babylons, cho biết, tới đây, Babylons không chỉ tổ chức các hoạt động hội thảo - khóa học quốc tế mang tính thực tế cao dành cho người lớn, mà thông qua liên kết với các hệ thống trường học và các tổ chức giáo dục hàng đầu thế giới, Babylons đang xây dựng hệ thống giáo dục quốc tế kết hợp giữa điểm mạnh của giáo dục trong trường học và giáo dục ngoài trường học, giữa học thuật và thực tế… để nuôi dưỡng những thế hệ trẻ Việt Nam phát triển tư duy, kiến thức, kỹ năng mới, giúp họ tự tin sẵn sàng cho hành trình tương lai.<br>', , '', 'Babylons tập trung chủ yếu vào việc thúc đẩy phát triển tư duy của các cá nhân, chủ doanh nghiệp, khơi dậy niềm đam mê kinh doanh thực sự trong lòng họ và giúp họ xác định được những hướng đi đúng đắn, thông qua những kiến thức, kinh nghiệm thực tiễn từ các khóa học - hội thảo mang tầm quốc tế do Babylons tổ chức.<br>', '11-100', '15-05-2022 07:05 PM [EAT +03:00]', 'employer', ' https://www.pureitwater.com/VN/', '25f9e794323b453885f5181f1b624d0b', 'CM704400294');
INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('CÔNG TY CỔ PHẦN TẬP ĐOÀN ITP', '', '-', '-', '-', '2019', 'company3@gmail.com', '-', 'Công Nghệ', 'TP Hồ Chí Minh', '144 Bạch Đằng , Phường 2, Quận Tân Bình', ' ', 'Vietnam', '+84123456789', '<p>Công ty Cổ phần Tập đoàn ITP (ITP Group) là tập đoàn công nghệ tiên phong hỗ trợ toàn diện các doanh nghiệp SME trong cộng đồng Việt toàn cầu.</p><p>Trong suốt 2 năm hình thành và phát triển với phương châm TÂM - TẦM - TÀI - TỐC - TRÍ, ITP Group đã có hơn 100 dự án hoàn thành, hơn 1000 khách hàng thân thiết là những tập đoàn lớn nhỏ đã hợp tác cùng ITP và hoàn thành các dự án thành công vang dội; hàng chục công ty thành viên và văn phòng đại diện trên toàn quốc cùng đội ngũ hơn 500 nhân sự. Song song đó đồng hành cùng các doanh nghiệp để tạo ra các chiến binh xuất sắc nhất trong ngành Digital như ADS, SEO,...<br></p><p>ITP Group có Tầm nhìn – Sứ mạng không chỉ mang lại giá trị lợi ích thiết thực cho đối tác, khách hàng, cộng đồng mà còn hướng tới là một nơi làm việc tốt nhất, với mức lương thưởng cao so với thị trường với các chính sách đãi ngộ, thu hút nhân sự đủ Đức và Tài. ITP đặt mục tiêu: Con người tinh hoa – Sản phẩm, Dịch vụ tinh hoa – Cuộc sống tinh hoa – Xã hội tinh hoa.</p><p>Tinh thần không ngừng đổi mới, sáng tạo, nắm bắt xu hướng phát triển công nghệ tài chính từ nền tảng fintech, ITP Group mong muốn kiến tạo nên hệ sinh thái sản phẩm, dịch vụ đẳng cấp, vươn lên vị trí top đầu tại Việt Nam và khu vực. <br></p><div><br><br></div><p></p><p></p><p></p><p></p><p></p><p></p>', , '&nbsp;', 'Đầu tư Tài chính – Bất động sản – Công nghệ – Truyền thông &amp; Marketing. <br>', '1000+', '15-05-2022 06:05 PM [EAT +03:00]', 'employer', 'https://itp29.com/', '25f9e794323b453885f5181f1b624d0b', 'CM766073055'),
('Công Ty Cổ Phần Viễn Thông FPT', '', '-', '-', '-', '2016', 'company8@gmail.com', '-', 'Giáo Dục', 'Hà Nội', 'Số 61 Ngụy Như Kon Tum, Thanh Xuân, Hà Nội.', ' ', 'Vietnam', '+84123456789', '<p>Bibabo là hệ sinh thái giáo dục tiên phong tại Việt Nam, đồng hành cùng con từ khi còn là một bào thai đến khi con vững bước trưởng thành.</p><p>Được thành lập từ năm 2015, Bibabo đã có những bước chuyển mình mạnh mẽ, trở thành nền tảng mua sắm dạng mạng xã hội dành riêng cho Mẹ &amp; Bé với kho thông tin, kiến thức khổng lồ chính xác - dễ tra cứu. Đồng thời tại Bibabo, mẹ sẽ có những trải nghiệm mua sắm online tuyệt vời dễ dàng, tiện lợi.</p>', , '<p>Hệ sinh thái bao gồm:</p><p>-Nền tảng giáo dục trực tuyến: giúp các mẹ vững tin hơn trên hành trình đồng hành cùng con nhờ những kiến thức bổ ích đến từ các khóa học trực tuyến, điển hình như: \"Thai Giáo 280 ngày yêu thương\", \"Giáo dục sớm cho trẻ từ 0-12 tháng\", \"Chinh phục tiếng Anh\", \"Cùng con học Toán\", v/v.</p><p>-Mua sắm: Trải nghiệm mua sắm tại gian hàng chính hãng của Bibabo trên ứng dụng online và hệ thống cửa hàng offline. Đặc biệt, Bibabo đã hợp tác với các nhà sản xuất có kinh nghiệm lâu năm nghiên cứu và phát triển thành công các thương hiệu dành riêng cho mẹ bầu như: Mỹ phẩm dành cho mẹ bầu Lagumi; thời trang bầu Lynafa và máy hút sữa Rozabi</p><p>-Cộng đồng: Khám phá cộng đồng Mẹ &amp; Bé qua tâm sự, chia sẻ kinh nghiệm làm mẹ, kết nối tư vấn giải đáp cùng các chuyên gia, và có trải nghiệm mua sắm dễ dàng hơn.</p>', '<p>Hiện nay, Bibabo có gần 4 triệu thành viên hoạt động trên 63 tỉnh thành, 1 bang tại Mỹ và là nền tảng lớn tại Việt Nam cung cấp dịch vụ này.</p><p>Với tư tưởng không ngừng học hỏi, sáng tạo, Bibabo định hướng trở thành nền tảng mua sắm dạng mạng xã hội - Social Commerce đa quốc gia với hơn 10 triệu người dùng tại Việt Nam và hướng tới người dùng trên thế giới. Bibabo mong muốn sẽ là lựa chọn tốt nhất cho mọi gia đình!</p><p>Hãy cùng chúng tôi trải nghiệm Bibabo</p>', '300+', '15-05-2022 07:05 PM [EAT +03:00]', 'employer', ' https://bibabo.vn/home', '25f9e794323b453885f5181f1b624d0b', 'CM917255147'),
('Nguyen Van', 'A', '-', '-', '-', '-', 'nguyenvana@gmail.com', '-', 'Your professional', '-', '-', '-', '-', '-', NULL, NULL, NULL, NULL, '-', '15-05-2022 06:05 PM [EAT +03:00]', 'employee', '-', '25d55ad283aa400af464c76d713c07ad', 'EM083119981');
